	add("cenobite", "{\"term\":\"cenobite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027cenobite\u0027 or \u0027coenobita\u0027 from \u0027coenobium\u0027 from Ancient greek (to 1453) \u0027κοινόβιον\u0027 (community life, convent) from \u0027κοινός\u0027 (community) + \u0027βίος\u0027 (life)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A new or recent member of a Greek monastic religious order; a caloye\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, w:Anthony Anthony Burgess, \u0027w:Earthly Earthly Powers\u0027, page 418\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Lamprecht knew very well how the war was going and was perfunctory in his rounding up of Jews and \u0027\u0027cenobites\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A monk who lives in a religious community, rather than in solitude\", \"priority\":4}]}, \"synonyms\":{}}");

	add("cenobium", "{\"term\":\"cenobium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the Latin {{m|la|coenobium||monastery, monastic community}}, from the {{m|grc|κοινόβιον||monastery, monastic community}}, from {{m|grc|κοινόβιος||communal living}}, from {{m|grc|κοινός||common, shared}} + {{m|grc|βίος||life}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A , a community\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, E. C. Butler, \u0027Chapter XVIII: Monasticism\u0027, H. M. Gwatkin, J. P. Whitney (editors), \u0027The Cambridge Medieval History\u0027, Volume 1, [http://books.google.com.au/books?id\u003dZus8AAAAIAAJ\u0026amp;pg\u003dPA529\u0026amp;dq\u003d%22lauras%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d-Cs1U8aZIcjNkwWDv4CICQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22lauras%22\u0026amp;f\u003dfalse page 529\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There were the \u0027\u0027cenobia\u0027\u0027, or monasteries proper, where the life was according to the lines laid down by St Basil; and there were the lauras, wherein a semi-eremitical life was followed, the monks living in separate huts within the enclosure\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Robert Imperato, \u0027Early and Medieval Christian Spirituality\u0027, [http://books.google.com.au/books?id\u003d2trjD2gtL_0C\u0026amp;pg\u003dPA45\u0026amp;dq\u003d%22cenobium%22%7C%22cenobiums%22%7C%22cenobia%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXHU1U7_bGMK_lQXP1oD4Bw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cenobium%22%7C%22cenobiums%22%7C%22cenobia%22\u0026amp;f\u003dfalse page 45\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Psalmody refers to singing or reciting psalms; in the \u0027\u0027cenobium\u0027\u0027 this was performed communally seven times a day\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, John Michael Talbot, \u0027Blessings of St. Benedict\u0027, [http://books.google.com.au/books?id\u003dGQ_CBYe3G4sC\u0026amp;pg\u003dPT1\u0026amp;dq\u003d%22cenobium%22%7C%22cenobiums%22%7C%22cenobia%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXHU1U7_bGMK_lQXP1oD4Bw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cenobium%22%7C%22cenobiums%22%7C%22cenobia%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Yet he also says that the \u0027\u0027cenobium\u0027\u0027 is the better way for most. Monastic history began with hermits and developed from loose colonies to formal communities\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Mark Sheridan, \u0027From the Nile to the Rhone and Beyond: Studies in Early Monastic Literature and Scriptural Interpretation\u0027, [http://books.google.com.au/books?id\u003dGbRXBptsqG4C\u0026amp;pg\u003dPA417\u0026amp;dq\u003d%22cenobium%22%7C%22cenobiums%22%7C%22cenobia%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d-Gs1U5jpG8y7kQXHv4DwBQ\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22cenobium%22%7C%22cenobiums%22%7C%22cenobia%22\u0026amp;f\u003dfalse page 417\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027cenobium\u0027\u0027 is the proper locus for the acquisition of virtue and in the nineteenth conference he has the Abbot John, who had passed thirty years in the \u0027\u0027cenobium\u0027\u0027, twenty as an anchorite and then returned to the \u0027\u0027cenobium\u0027\u0027, expound the dangers of the desert and the advantages of the \u0027\u0027cenobium\", \"priority\":13}]}, \"synonyms\":{}}");

	add("cenotaph", "{\"term\":\"cenotaph\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027cénotaphe\u0027 from Ancient greek (to 1453) \u0027κενός\u0027 (empty) + \u0027τάφος\u0027 (tomb)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monument erected to honour the dead whose bodies lie elsewhere; especially members of the armed forces who died in battle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("censor", "{\"term\":\"censor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla|cēnsor\u0027 () from \u0027censo\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Roman magistrate, originally a census administrator, by Classical times a high judge of public behavior and moralit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Ancient \u0027\u0027censors\u0027\u0027 were part of the \u0027cursus honorum\u0027, a series of public offices held during a political career, like consuls and praetors\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An official responsible for the removal of objectionable or sensitive conten\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The headmaster is an even stricter \u0027\u0027censor\u0027\u0027 for his boarding pupils\u0027 correspondence than the enemy \u0027\u0027censors\u0027\u0027 had been for his own when the country was occupied\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One who censures or condemn\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A hypothetical subconscious agency which filters unacceptable thought before it reaches the consciou\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"acronym\u0027) Censors Ensure No Secrets Over Radios\", \"priority\":7}]}, \"synonyms\":{}}");

