	add("censorware", "{\"term\":\"censorware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|censor|ware|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Software or hardware used to filter content on the Internet or block Internet access or restrict the running of applications or computer usage. Content filtering software, or a component in an operating system or console used to disable reception of media on the basis of content believed to be objectionable\", \"priority\":1}]}, \"synonyms\":{}}");

