	add("centromere", "{\"term\":\"centromere\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"From German \u0027centromer\u0027 corresponding to \u0027\u0027 + Ancient greek (to 1453) \u0027μέρος\u0027 (part)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The central region of a eukaryotic chromosome where the kinetochore is assembled\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027Genome\u0027, Harper Perennial 2000, p. 16\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Every chromosome has a long arm and a short arm separated by a pinch point known as a \u0027\u0027centromere\", \"priority\":3}]}, \"synonyms\":{}}");

