	add("centrosome", "{\"term\":\"centrosome\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|centro|some|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organelle, near the nucleus in the cytoplasm of most organisms, that controls the organization of its microtubules\", \"priority\":1}]}, \"synonyms\":{}}");

