	add("centumvir", "{\"term\":\"centumvir\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin from \u0027centum\u0027 (hundred) \u0027vir\u0027 (man)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of a court of about 100 judges chosen to try civil suits. Under the Empire the court was increased to 180, and met usually in four sections\", \"priority\":1}]}, \"synonyms\":{}}");

