	add("century", "{\"term\":\"century\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|centurie||a count of one hundred (of anything); a division of the Roman army; century; a division of land}}, from Old french (842-ca. 1400) {{m|fro|centurie}}, from Latin \u0027centuria\u0027 from \u0027centum\u0027 (one hundred) The modern use is derived from a shortening of \u0027century of years\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A period of 100 consecutive years; \u0027often specifically\u0027 a numbered period with conventional start and end dates, e.g., the \u0027twentieth century\u0027, which stretches from (\u0027strictly\u0027) 1901 through 2000, or (\u0027informally\u0027) 1900 through 1999. The \u0027first century AD\u0027 was from 1 to 100; a yearhundred\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003dForeword|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dHe stood transfixed before the unaccustomed view of London at night time, a vast panorama which reminded him [\u0026amp;hellip;] of some wood engravings far off and magical, in a printshop in his childhood. They dated from the previous \u0027\u0027century\u0027\u0027 and were coarsely printed on tinted paper, with tinsel outlining the design\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/http://www.economist.com/news/business/21582001-army-new-online-courses-scaring-wits-out-traditional-universities-can-they The attack of the passage\u003dSince the launch early last year of\u0026amp;nbsp;[\u0026amp;hellip;] two Silicon Valley start-ups offering free education through MOOCs, massive open online courses, the ivory towers of academia have been shaken to their foundations. University brands built in some cases over \u0027\u0027centuries\u0027\u0027 have been forced to contemplate the possibility that information technology will rapidly make their existing business model obsolete\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A unit in ancient Roman army, originally of 100 army soldiers as part of a cohort, later of more varied sizes (but typically containing 60 to 70 or 80) soldiers or other men (guards, police, firemen), commanded by a centurion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A political division of ancient Rome, meeting in the Centuriate Assembly\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; A hundred things; a hundred\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"II.4.2.i\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"tis the subject of whole books: I might cite a \u0027\u0027century\u0027\u0027 of authors \u0027pro\u0027 and \u0027con\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; A hundred runs scored either by a single player in one innings, or by two players in a partnership\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; A ride 100 kilometres in length\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; A banknote in the denomination of one hundred dollars\", \"priority\":11}]}, \"synonyms\":{}}");

